import Vue from 'vue'
import Router from 'vue-router'
import List from './pages/list/List'
import City from './pages/city/City'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/city',
      name: 'city',
      component: City
    },
    {
      path: '/list',
      name: 'list',
      component: List
    }
  ]
})
